import React from 'react';
import IMG from '../images/svg/foots_footer_img.svg';

function HomeFooterParalax() {
  return (
    <div className="home-footer-paralax-img">
      <img src={IMG} alt="foots" />
    </div>
  );
}

export default HomeFooterParalax;
